import './App.css';
import Home from './Components/Home';

function App() {
  return (
    <div>
       <Routes>
        <Route key='home' path="/" exact element={<Home />}></Route>
        <Route key='aboutpage' path="/about" element={<AboutUs />}></Route>
        </Routes>
     <Home></Home>
    </div>
  );
}

export default App;
